import styled from "styled-components";

const Father = styled.div`
  display: flex;
`;

const Btn = styled.button`
  color: white;
  background-color: tomato;
  border: 0;
  border-radius: 15px;  
`;



//이전 방법처럼 확장하는 것이 아닌 html 태그를 변경하는 방법 
function App() {
  return <Father>
    <Btn>Log in</Btn>

    <Btn as="a" href="/">
      Log in
    </Btn>
  </Father>;

}

export default App;
